import React, { Component } from 'react';
import AddToCart from './AddToCart';

class Product extends Component {
  render() {
    const {imageUrl, offerText, brandName, productName, price, mrf, quantity, count, productId} = this.props.product;
    return (
      <tr style={{}}>
        <th style={{}}>
          <img style={{}} src={imageUrl} alt="product" />
          <div>{offerText} OFF</div>
        </th>
        <th style={{}}>
          <div>{brandName}</div>
          <div>{productName}</div>
          <div>{quantity}</div>
          <div>{price}</div>
          <div>{mrf}</div>
          <AddToCart count={count} productId={productId} />
        </th>
      </tr>
    );
  }
}

export default Product;
